import "./App.css";
import React, { Component } from "react";
import Nav from "react-bootstrap/Nav";
import name from "./name.png";

export default class App extends Component {
  constructor(props) {
    super(props);
  }

  headerStyle = {
    display: "flex",

  };

  render() {
    return (
      <div className="App">
        <div style={this.headerStyle}>
          <a href="/" aria-current="page" aria-label="home">
            <img src={name} width="250" alt="" />
          </a>
          <Nav>
            <Nav.Item>
              <Nav.Link href="#home">My Work</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#link">About Me</Nav.Link>
            </Nav.Item>
          </Nav>
        </div>

        <div>
          <h1>
            Hola - I'm Caro Collazo :)
            <br />A creative...
          </h1>

          <div>
            <i>currently a software engineer @ Microsoft</i>
          </div>
        </div>
        <div>
          <div>Project</div>
          <div>Project</div>
          <div>Project</div>
          <div>Project</div>
        </div>
      </div>
    );
  }
}
